import React from "react";
import ReactDOM from "react-dom";
import { createRoot } from "react-dom/client";  // Import from "react-dom/client" instead of "react-dom"
import App from "./App";
import 'bootstrap/dist/css/bootstrap.min.css';

const rootElement = document.getElementById("root");

const root = rootElement.createRoot ? rootElement.createRoot() : createRoot(rootElement);  // Use createRoot from react-dom/client
root.render(<App />);
